	@Inject
	public Draft7GrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pSchema = new SchemaElements();
		this.pDependencies = new DependenciesElements();
		this.pPropertyDependency = new PropertyDependencyElements();
		this.pContains = new ContainsElements();
		this.pItems = new ItemsElements();
		this.pAdditionalProperties = new AdditionalPropertiesElements();
		this.pAdditionalItems = new AdditionalItemsElements();
		this.pDefault = new DefaultElements();
		this.pExample = new ExampleElements();
		this.pTypes = new TypesElements();
		this.pAbstractSchema = new AbstractSchemaElements();
		this.pReference = new ReferenceElements();
		this.pNamedSchema = new NamedSchemaElements();
		this.eBoolean = new BooleanElements();
		this.eJsonTypes = new JsonTypesElements();
		this.eFormatTypes = new FormatTypesElements();
		this.pAnyString = new AnyStringElements();
		this.pNumber = new NumberElements();
		this.eJsonSchemaKeyword = new JsonSchemaKeywordElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.json.schema.Draft7".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
